import React from 'react';
import IndexPage from './IndexPage';
import useAuth from "../hooks/useAuth";

function LogoutPage() {
    if (useAuth) {
        fetch(`/logout`, {
            'method': 'POST',
            headers: {
                'Content-Type': 'application/json'
            }
        })
            .then(response => response.json())
            .catch(error => console.log(error))

    }
    return (
        <IndexPage />
    )
}

export default LogoutPage
